import React from "react";
import { Track } from "../../api/track/models/Track";
import { Box, Typography, List, ListItem, Divider, Paper } from "@mui/material";
import { PageList } from "../../types/PageList";
import { TrackListItem } from "./TrackListItem";

interface Props {
  tracks: PageList<Track> | undefined;
  onTrackDelete: (trackId: string) => void;
  onTrackUpdated: (track: Track) => void;
}

export const TrackList: React.FC<Props> = ({
  tracks,
  onTrackDelete,
  onTrackUpdated,
}) => {
  return (
    <Box
      sx={{
        width: "100%",
        maxWidth: 1200,
        margin: "0 auto",
        p: { xs: 2, md: 4 },
        minHeight: "100vh",
      }}
    >
      {/* –ó–∞–≥–æ–ª–æ–≤–æ–∫ */}
      <Typography
        variant="h3"
        gutterBottom
        sx={{
          fontWeight: 700,
          textAlign: "center",
          mb: 5,
          background: "linear-gradient(135deg, #667eea 0%, #764ba2 100%)",
          backgroundClip: "text",
          WebkitBackgroundClip: "text",
          WebkitTextFillColor: "transparent",
          letterSpacing: -0.5,
          fontSize: { xs: "2rem", md: "3rem" },
        }}
      >
        üé∂ My Tracks
      </Typography>

      {/* –°–ø–∏—Å–æ–∫ */}
      <Box
        sx={{
          display: "flex",
          flexDirection: "column",
          gap: 2,
        }}
      >
        {tracks?.data.map((track, index) => (
          <Box key={track.id}>
            <TrackListItem
              track={track}
              onDelete={onTrackDelete}
              onTrackUpdated={onTrackUpdated}
            />
          </Box>
        ))}
      </Box>
    </Box>
  );
};
